ncuentran a distintos niveles, verificar los volumenes de excavacion y nivelación, para que los cordones no tengan una gran altura o en su caso incluir un muro de contension como contraparte.',NULL,NULL,NULL,NULL,'2022-10-12','INF/FPS/GDXX Nº 0XXX/2022','NO','SI','2022-10-06','1 Carpeta (fojas 300 y 1 CD)','SI',5,'2022-10-03 09:24:30','2022-10-19 15:55:51'),(274,'BOL 34-00254','E/CN/2022-04013',28,'CONSTRUCCION ENLOSETADO ZONA REMEDIOS-CHAJRAHUASI D-XI (TUPIZA)','MPD/VIPFE/DGPP/UPI-NE 1917/2022','2022-10-03',2844253.22,91005.94,12399.50,2935259.16,0.00,50.00,10.00,17.00,0.00,'TUPIZA',NULL,NULL,'G.A.M.',NULL,'C',NULL,'RECIBIDO','SE RECOMIENDA LA NO PRIORIZACION DEL PROYECTO PORQUE NO CUMPLE TOTALMENTE LOS REQUISITOS Y CRITERIOS DE ELEGIBILIDAD DEL PROGRAMA NACIONAL DE EMERGENCIA PARA LA GENERACIÓN DE EMPLO BOL-34. Se recomienda mejorar las calles circundantes a espacios públicos, evidenciando que los puntos priorizados distan entre si mas de 2000mts lineales, como ejemplo la plazoleta chajrahuasi que dista de 2.28km con la calle de la unidad educativa Genoveva Ríos, se justifica para ello un incremento en los ítems instalación de faenas y  movilización de maquinaria el cual debe triplicarse según la priorización del enlosetado para el proyecto.',NULL,NULL,NULL,NULL,'2022-10-10','INF/FPS/GDXX Nº 0XXX/2022','NO','SI','2022-04-10','1 Carpeta (fojas 234 y 1 CD)','SI',5,'2022-10-03 09:27:25','2022-10-19 16:22:21'),(275,'BOL 34-00255','E/CN/2022-04015',29,'CONSTRCCION ENLOSETADO  ZONA SAN ANTONIO  D-XI (TUPIZA)','MPD/VIPFE/DGPP/UPI-NE1918/2022','2022-10-03',2905907.31,91005.94,12926.99,2996913.25,0.00,50.00,10.00,16.00,0.00,'TUPIZA',NULL,NULL,'G.A.M.',NULL,'C',NULL,'RECIBIDO','SE RECOMIENDA LA PRIORIZACION DEL PROYECTO POR QUE CUMPLE LOS REQUISITOS Y CRITERIOS DE ELEGIBILIDAD DEL PROGRAMA NACIONAL DE EMERGENCIA PARA LA GENERACIÓN DE EMPLEO BOL-34. ADEMAS SE RECOMIENDA QUE EL MONTO PRESENTADO POR EL SOLICITANTE DEBE SER AJUSTADO DE BS 2.905.907,31 A BS 2.996.913,25 PUESTO Q