78950.93,0.00,50.00,10.00,29.00,0.00,'COBIJA',NULL,NULL,'G.A.M.',NULL,'C',NULL,'ENVIADO','SE RECOMIENDA QUE LOS PLANOS ESTEN MAS ESPECIFICOS INDICANDO LA UBICACION EXACTA DE LOS SUMIDEROS Y CAMARAS DE INSPECCION  EN EL AREA A ENLOSETAR ( VISTA EN PLANTA).\nMEJORAR LAS REFERENCIAS DE LOS PERFILES  LONGITUDINALES Y TRANSVERSAL\nEN LA CALLE DONDE SE ENCUENTRA EL PUENTE EN UNO DE LOS LADOS SE REQUIERE QUE EL PROYECTO CONTEMPLE TRABAJOS DE OBRAS DE DRENAJE PLUVIAL PARA GARANTIZAR LA FUNCIONALIDAD DEL ENLOSETADO',NULL,NULL,NULL,NULL,'2022-10-31','INF/FPS/GDXX Nº 0XXX/2022','NO','SI','2022-11-04','1 Carpeta (fojas 296 y CD)','SI',9,'2022-10-25 15:15:03','2022-11-10 16:50:48'),(453,'BOL 34-00449','E/CN/2022-04504',11,'CONSTRUCCIÓN ENLOSETADO CALLES EN VILLA ROJAS DEL MUNICIPIO DE PORVENIR','MPD/VIPFE/DGPP/UPI-NE 2305/2022','2022-10-25',2852800.60,142640.03,4696.60,2995440.63,0.00,50.00,10.00,7.00,0.00,'PORVENIR',NULL,'MITIGACION AMBIENTAL','G.A.M.','otro-','B',NULL,'PRIORIZADO','El proyecto no cumple por que en el volumen del ítem:04.3 VIGA DE H°A° FUNDACION no considero la cantidad suficiente de vigas de H°A° para cada una de las calles, lo cual afecta sustancialmente al proyecto pues estas vigas cumplen la función de formar una faja o cinta a modo de sujeción para las losetas, estas vigas se construyen al comenzar y terminar cada intersección, cuando hay cambios de pendientes en las vías. Se ubican preferentemente cada 20 metros y como se puede apreciar en los cómputos métricos la cantidad que considero es insuficiente-\nTambién se observa que en el cómputo del ítem:03.8 H°A° PARA OBRAS DE DRENAJE presenta dimensiones que no están de acuerdo a los planos',NULL,NULL,NULL,NULL,'2022-10-26','INF/FPS/GDXX Nº 0XXX/2022','NO','SI','2022-10-26','1 Carpeta (fojas 257 y CD)','SI',9,'2022-10-25 15:24:10','2022-11-21 09:24:07'),(454,'BOL 34-00446','E/CN/2022-04503',12,'MEJORAMIENTO DE VÍAS URBANAS CON LOSETAS EN EL BARRIO PETROLERO DEL MUNICIPIO DE COBIJA','MPD/VIPFE/DGPP/UPI-NE 2302/2022','2022-10-25',2663083.97,133154.20,5041.79,2796238.17,0.00,50.00,10.00,16.00,0.00,'COBIJA',NULL,NULL,'G.A.M.',NULL,'C',NULL,'ENVIADO','El proyecto no cumple porque en el cómputo del ítem: HORMIGON SIMPLE H21 (REMATES) presenta la unidad en metros lineales, pero se computo como metros cúbicos lo cual genera gran variación en el volumen total afectando de esta manera el presupuesto.\nTambién se observa que en los cómputos del ítem: PROV. Y COLOCADO DE CAMA DE ARENA no se consideró un área ya que constructivamente las vías a enlosetarse tiene que contar una cama de arena y en este caso está faltando un área de intersección; lo cual hace que el volumen total de la cama de arena tendría que incrementarse generando así otra variación en el presupuesto',NULL,NULL,NULL,NULL,'2022-10-27','INF/FPS/GDXX Nº 0XXX/2022','NO','SI','2022-10-26','1 Carpeta (fojas 198 y CD)','SI',9,'2022-10-25 15:30:54','2022-11-10 16:56:47'),(455,'BOL 34-00455','E/CN/2022-04508',29,'CONSTRUCCION ENLOSETADO DE VÍAS URBANAS (C.S. SANDRO ISIDRO DE ANFAYA - U.E. SAN ISIDRO DE ANFAYA) COMUNIDAD SAN ISIDRO DE ANFAYA, MUNICIPIO YOTALA','MPD/VIPFE/DGPP-NE 2324/2022','2022-10-25',2880193.31,100000.00,9638.60,2980193.31,0.00,50.00,10.00,5.00,0.00,'YOTALA',NULL,NULL,'G.A.M.',NULL,'B',NULL,'ENVIADO','DE LA REVISION REALIZADA A LA DOCUMENTACION CONCERNIENTE SE DETERMINA QUE EL PROYECTO PRESENTADO CUMPLE CON LOS CRITERIOS Y REQUISITOS ESTABLECIDOS EN EL ROP DEL PROGRAMA BOL-34',NULL,NULL,NULL,NULL,'2022-11-14','INF/FPS/GDXX Nº 0XXX/2022','SI','SI','2022-11-11','1 Carpeta (fojas 565 y 1CD)','SI',1,'2022-10-25 15:32:36','2022-11-18 10:18:47'),(456,'BOL 34-00441','E/CN/2022-04506',13,'MEJORAMIENTO DE VÍAS URBANAS CON LOSETAS EN EL BARRIO MADRE NAZARIA DEL MUNICIPIO DE COBIJA','MPD/VIPFE/DGPP/UPI-NE 2293/2022','2022-10-25',2850841.51,142542.08,5342.77,2993383.59,0.00,50.00,10.00,23.00,0.00,'COBIJA',NULL,NULL,'G.A.M.',NULL,'C',NULL,'RECIBIDO','SE RECOMIENDA REVISAR LA INCLUSION DE LA CALLE SIN DENOMINACION DE A