 REALIZADA EN CAMPO SE PUDO EVIDENCIAR QUE EN LA INTERSECCIÓN ENTRE LA AVENIDA ASFALTADA Y EL TRAMO PROYECTADO PARA ENSOLETAR SE TIENE EL MURO PERIMETRAL DE LA ESCUELA SUPERIOR DE FORMACIÓN DE MAESTROS COBIJA, TENIENDO EL INGRESO PRINCIPAL A 100 METROS DEL TRAMO ASFALTADO.\nSE TIENE CERCANO AL PROYECTO LA UNIDAD EDUCATIVA ALFREDO OVANDO CANDIA.\nLOS COMPUTOS MÉTRICOS Y EL CRONOGRAMA DE EJECUCIÓN DEBEN SER COMPLETADOS EN LA TOTALIDAD DE LOS ITEMS DE PROYECTO.\nLOS PLANOS CONSTRUCTIVOS DEBEN DETALLAR LAS PROGRESIVAS DEL TRAMO, COMPLEMENTAR PERFIL LONGITUDINAL Y SECCIONES TRANSVERSALES.\nMEJORAR LOS DETALLES CONSTRUCTIVOS DE LAS OBRAS DE DRENAJE Y ESPECIFICAR SU UBICACIÓN.\nNO EXISTE CORRELACIÓN ENTRE LOS ITEMS DE LOS PRECIOS UNITARIOS Y ESPECIFICACIONES TÉCNICAS Y COMPLEMENTAR LAS MISMAS.',NULL,NULL,NULL,NULL,'2022-10-31','INF/FPS/GDXX Nº 0XXX/2022','NO','SI','2022-11-07','1 Carpeta (fojas 214 y CD)','SI',9,'2022-10-27 12:15:27','2022-11-10 16:51:22'),(505,'BOL 34-00497','E/CN/2022-04608',39,'CONSTRUCCION ENLOSETADO CALLES CHAQUI','MPD/VIPFE/DGPP/UPI-NE 2416/2022','2022-10-27',1641633.31,101784.56,5753.41,1743417.87,0.00,50.00,10.00,11.00,0.00,'CHAQUI',NULL,NULL,'G.A.M.',NULL,'B',NULL,'RECIBIDO','SE RECOMIENDA LA PRIORIZACION DEL PROYECTO POR QUE CUMPLE LOS REQUISITOS Y CRITERIOS DE ELEGIBILIDAD DEL PROGRAMA NACIONAL DE EMERGENCIA PARA LA  GENERACIÓN DE EMPLEO BOL-34. SE RECOMIENDA QUE EL MONTO PRESENTADO POR EL SOLICITANTE DEBE SER AJUSTADO DE BS 1.742.954,85 A BS 1.743.417,87.  LOS PRECIOS DE\nLOS MATERIALES E INCIDENCIAS QUE SE CONSIDERARON DEBEN AJUSTARSE DE ACUERDO A LOS PRECIOS REFERENCIALES DEL LUGAR.',NULL,NULL,NULL,NULL,'2022-10-31','INF/FPS/GDXX Nº 0XXX/2022','SI','SI','2022-11-07','1 Carpeta (fojas 172 y 1 CD)','SI',5,'2022-10-27 13:50:02','2022-11-08 18:26:32'),(506,'BOL 34-00513','E/CN/2022-04629',40,'CONSTRUCCION ENLOSETADO BARRIO VILLA FLORIDA ESTE - OESTE D-XII (TUPIZA)','MPD/VIPFE/DGPP/UPI-NE4629/2022','2022-10-27',2898038.96,91005.94,12948.20,2989044